function Home() {
    return (
        <>
        <HomeContainer>
        <div className="wrapper">
            <h1 style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '10vh', color: 'grey' }}>
               Home page</h1>


            </div>
            </HomeContainer>
            </>
    )
}
export default Home;
